message = ""

indexFound = False

#part 1
for x in range(0,len(message)-3):
    noRepeats = True

    currString = []

    for n in range(0,4):
        currString.append(message[x+n])

    while currString != []:
        c = currString.pop()
        if c in currString:
            noRepeats = False

    if noRepeats == True and indexFound == False:
        indexFound = True
        print(x+4)

